import React, { useState } from "react";
import { getOrderDetails, deleteOrder } from "../API/OrderApi";

const SearchOrder = () => {
  // State to hold the order number, order details, and any errors
  const [orderNo, setOrderNo] = useState("");
  const [orderDetails, setOrderDetails] = useState(null);
  const [error, setError] = useState(null);
  const [successMessage, setSuccessMessage] = useState(null); // Added for success message

  // Handler for fetching order details
  const fetchOrderDetails = async () => {
    if (!orderNo) {
      setError("Please enter an order number");
      return;
    }

    try {
      setError(null); // Clear any previous error
      const response = await getOrderDetails(orderNo);

      // Check if the response contains the expected structure and data
      if (response && Array.isArray(response.data) && response.data.length > 0) {
        setOrderDetails(response.data[0]);
      } else {
        setError("No order details found");
        setOrderDetails(null);
      }
    } catch (err) {
      setError("An error occurred while fetching the order details");
      console.error(err);
    }
  };

  // Handle update action (you can add your update logic here)
  const handleUpdate = (orderNo) => {
    console.log("Updating order with OrderNo:", orderNo);
    // Add your update logic here
  };

  // Handle delete action
  const handleDelete = async (orderNo) => {
    try {
      setError(null); // Clear any previous error

      // Call deleteOrder API to delete the order
      const response = await deleteOrder(orderNo);

      if (response && response.success) {
        // Successfully deleted the order
        setSuccessMessage(`Order No ${orderNo} has been deleted successfully.`);
        setOrderDetails(null); // Optionally clear the displayed order details
      } else {
        // If the response does not indicate success, show an error
        setError("Failed to delete the order");
      }
    } catch (err) {
      setError("An error occurred while deleting the order");
      console.error(err);
    }
  };

  return (
    <div>
      <h2>Search Order</h2>
      <div>
        <input
          type="text"
          placeholder="Enter Order No"
          value={orderNo}
          onChange={(e) => setOrderNo(e.target.value)}
        />
        <button onClick={fetchOrderDetails}>Search</button>
      </div>

      {error && <p style={{ color: "red" }}>{error}</p>}
      {successMessage && <p style={{ color: "green" }}>{successMessage}</p>} {/* Success message display */}

      {orderDetails && (
        <div>
          <h3>Order Details</h3>
          <table border="1" cellPadding="10" style={{ width: "100%", marginTop: "20px" }}>
            <thead>
              <tr>
                <th>Order No</th>
                <th>Order Date</th>
                <th>Order Status</th>
                <th>Client</th>
                <th>Article No</th>
                <th>Delivery Date</th>
                <th>Approved By</th>
                <th>Date</th>
                <th>User ID</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              <tr key={orderDetails.OrderNo}>
                <td>{orderDetails.OrderNo}</td>
                <td>{new Date(orderDetails.OrderDate).toLocaleString()}</td>
                <td>{orderDetails.OrderStatus}</td>
                <td>{orderDetails.Client}</td>
                <td>{orderDetails.ArticleNo}</td>
                <td>{new Date(orderDetails.DelieveryDate).toLocaleString()}</td>
                <td>{orderDetails.ApprovedBy}</td>
                <td>{new Date(orderDetails.Date).toLocaleString()}</td>
                <td>{orderDetails.UserId}</td>
                <td>
                  <button onClick={() => handleUpdate(orderDetails.OrderNo)}>Update</button>
                  <button onClick={() => handleDelete(orderDetails.OrderNo)}>Delete</button>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default SearchOrder;
